import React from "react";
import Search from "./Search";
import Img from "./Img";
import Subtitle from "./Subtitle";
import Cards from "./Cards";
import { Link } from "react-router-dom";

const IngData = [
  {
    link: "https://picsum.photos/250",
    title: "Ing 1",
  },
  {
    link: "https://picsum.photos/250",
    title: "Ing 2",
  },
  {
    link: "https://picsum.photos/250",
    title: "Ing 3",
  },
  {
    link: "https://picsum.photos/250",
    title: "Ing 4",
  },
];

const ProData = [
  {
    link: "https://picsum.photos/250",
    title: "Pro 1",
  },
  {
    link: "https://picsum.photos/250",
    title: "Pro 2",
  },
  {
    link: "https://picsum.photos/250",
    title: "Pro 3",
  },
  {
    link: "https://picsum.photos/250",
    title: "Pro 4",
  },
];

function Home() {
  return (
    <div className="container">
      <Img
        link={"https://picsum.photos/500/300"}
        alt={"EcoSunscreen-headimg"}
      />

      <Search />
      <Subtitle text={"Ingredients"} />

      <Link to="/ingredients">
        <h3 className="more">More Ingredients</h3>
      </Link>
      <Cards cardData={IngData} />
      <Subtitle text={"Products"} />

      <Link to="/products">
        <h3 className="more">More Products</h3>
      </Link>
      <Cards cardData={ProData} />
    </div>
  );
}

export default Home;
